(def fraction-odd-as-function-of-training-data-length 
  (loop [N 2 purities {}]
  (if (> N 10000)
    purities
    (let [samples (doquery :lmh pdia N)
          fo (fraction-odd 50000 samples)]
       (prn N)
       (recur (* N 2) (conj purities {N fo}))))))
